CREATE TABLE `ventas` (
  `fcompra` date NOT NULL,
  `transid` bigint(20) NOT NULL,
  `uagent` varchar(64) NOT NULL,
  `ipv4` varchar(64) NOT NULL,
  `dirEnv` varchar(128) DEFAULT NULL,
  `personEnv` varchar(128) DEFAULT NULL,
  `city` varchar(64) NOT NULL,
  `prov` varchar(64) NOT NULL,
  `codCel` int(11) NOT NULL,
  `codNum` int(11) NOT NULL,
  `codTel` int(11) DEFAULT NULL,
  `numTel` int(11) DEFAULT NULL,
  `paisEnv` varchar(32) DEFAULT NULL,
  `totalcmp` double NOT NULL,
  `typPago` int(11) NOT NULL,
  `codPago` varchar(64) NOT NULL,
  `iduser` varchar(128) DEFAULT NULL,
  `extraPago` varchar(12) DEFAULT NULL,
  PRIMARY KEY (`transid`),
  KEY `iduser` (`iduser`),
  CONSTRAINT `ventas_ibfk_1` FOREIGN KEY (`iduser`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
